import React, { Component } from 'react'
import { connect } from 'react-redux'

export class CurrentInfo extends React.Component {
  render() {
    return (
      <div className='flex flex-col justify-center bg-sky-100 rounded-lg p-3'>
        <h3>Current Information</h3>
        <img src="https://mir-s3-cdn-cf.behance.net/project_modules/disp/8394f798931623.5ee79b6a909ea.jpg" className='rounded w-20'/>
        <div>
          <span>User Name: </span>
          <div>{this.props.userState.username}</div>
        </div>
        <div>
          <span>Email: </span>
          <div>{this.props.userState.email}</div>
        </div>
        <div>
          <span>Zipcode: </span>
          <div>{this.props.userState.zipcode}</div>
        </div>
        <div>
          <span>Phone: </span>
          <div>{this.props.userState.phone}</div>
        </div>
        <div>
          <span>Password: </span>
          <div>**********</div>
        </div>
      </div>
    )
  }
}

const mapStateToProps = (state) => {
    return {
        userState: state.riceZoneApp.currentUserState
    }
  };

const mapDispatchToProps = {}

export default connect(mapStateToProps, mapDispatchToProps)(CurrentInfo)
